cls:     
    ;backup previous register values
    push es
    push ax
    push di

    ;setup video mode
    mov ax, 0xb800
    mov es, ax
    mov di, 0

    ;clears one pixel at a time
    clrpixel:
        mov word[es:di], 0x0720
        add di, 2
        cmp di, 4000
        jne clrpixel

    ;set previous values of registers
    pop di
    pop ax
    pop es
    ret

drawSky:
    mov dx, 0x3C8         ; VGA palette index register
    mov al, 0x01          ; Set palette index to 1 (or any other index you need)
    out dx, al

    mov dx, 0x3C9         ; VGA palette data register
    mov al, 15            ; Red component (scaled 0-63)
    out dx, al
    mov al, 49            ; Green component (scaled 0-63)
    out dx, al
    mov al, 63            ; Blue component (scaled 0-63)
    out dx, al

    mov ax, 0xA000					
    mov es, ax 					
    mov di, 0 
    mov al, 1
    mov cx, 32000	
									
    nextchar: 	
		mov byte [es:di],al 				
		add di, 1						
						
		loop nextchar 
		ret 

drawStrokedRectangle:
    push bp
	mov bp,sp
    push ax
	push bx
	push cx
	push dx
	
	mov ax, 0xA000
	mov es, ax
	mov bx, 0
	mov cx, 0
	
	mov ax, 320
	mul word[bp+12]
	add ax, word[bp+10]
	
	mov di, ax
		
	outerloop:
		; Checks if bx >= rows then end
		cmp bx, word[bp+8]
		je end

		; If its first row then outline
		cmp bx, 0
		je drawLine
		
		mov ax, 0
		mov cx, 0
		mov dx, 0

		mov dx, bx
		inc dx
		cmp dx, word[bp+8]
		je drawLine
		
		; Used for outlineLeft
		mov al, 0x00
		
		innerloop:
			cmp cx, word[bp+6]
			je reset

			mov dx, cx
			inc dx
			cmp dx, word[bp+6]
			je outlineRight
			
			mov byte[es:di], al
			inc di
			inc cx
			mov al,[bp+4]
			jmp innerloop
			
		reset:
			inc bx
			mov ax, 320
			mov cx, [bp+12]
			add cx, bx
			mul cx
			add ax, word[bp+10]
			
			mov di, ax
			jmp outerloop

		drawLine:
			cmp cx, word[bp+6]
			je reset
			
			mov al, 0x00
			mov byte[es:di], al
			inc di
			inc cx
			jmp drawLine

		outlineRight:
			mov al, 0x00
			mov byte[es:di], al
			inc di
			inc cx
			jmp innerloop
	
	end:	    
		pop dx
		pop cx
		pop bx
		pop ax 
		mov sp,bp
		pop bp
		ret 10

setupPaletteBG:
    push bp
    mov bp, sp
    push ax
    push bx
    push cx
    push dx

    mov ax, 13h
    int 10h
    mov ax, 0xA000     
    mov es, ax

    mov dx, 03c8h   ; DAC write index register
    mov al, 0       ; Start at color index 0
    out dx, al
    mov dx, 03C9h   ; DAC data register
    mov cx, 768     ; 256 colors 3 (RGB)
    mov si, palette_data

    palette_loop:
        lodsb
        out dx, al
        loop palette_loop

    pop dx
    pop cx
    pop bx
    pop ax
    mov sp, bp
    pop bp

    ret

drawBackground:
    push bp
    mov bp, sp
    push ax
    push bx
    push cx
    push dx

    ;Plot pixels
    mov cx, 32000
    mov si, pixel_data
    mov di, 32000
    rep movsb

    pop dx
    pop cx
    pop bx
    pop ax
    mov sp, bp
    pop bp

    ret

drawRectangle:
    push bp
	mov bp,sp
    push ax
	push bx
	push cx
	push dx
	
	mov ax, 0xA000
	mov es, ax
	mov bx, 0
	mov cx, 0
	
	mov ax,320
	mul word[bp+12]
	add ax, word[bp+10]
	
	mov di, ax
		
	outerloop2:
		cmp bx, word[bp+8]
		je end2
		mov ax, 0
		mov cx, 0
		mov al,[bp+4]
		
		innerloop2:
			cmp cx, word[bp+6]
			je reset2
			 
			mov byte[es:di], al
			add di, 1
			inc cx
			jmp innerloop2
			
		reset2:
			inc bx
			mov ax, 320
			mov cx, [bp+12]
			add cx, bx
			mul cx
			add ax, word[bp+10]
			
			mov di, ax
			jmp outerloop2
	
	end2:	    
		pop dx
		pop cx
		pop bx
		pop ax 
		mov sp,bp
		pop bp
		ret 10

drawBirdXY:
    push bp
    mov bp, sp
    push ax
    push bx
    push cx
    push dx

    mov bx, [bp+6]      ;x coordinate
    mov cx, [bp+4]      ;y coordinate
    mov dx, 0           ;temp reg

	;body
	mov ax, bx          ;row no 
	push ax

	mov ax, cx          ;column no
	push ax

	mov ax, 10          ;length
	push ax

	mov ax, 15          ;width
	push ax

	mov ax, 0x2D        ;color
	push ax

	call drawRectangle 

	;tail
    mov dx, bx
    add dx, 5
	mov ax, dx          ;row no 
	push ax

    mov dx, cx
    sub dx, 5
	mov ax, dx          ;column no
	push ax

	mov ax, 5           ;length
	push ax

	mov ax, 15          ;width
	push ax

	mov ax, 0x2D
	push ax

	call drawRectangle 

	;feather
	mov dx, bx
    add dx, 10
	mov ax, dx          ;row no 

	push ax
	mov ax, cx          ;column no
	push ax

	mov ax, 3           ;length
	push ax

	mov ax, 10          ;width
	push ax

	mov ax, 0x2D
	push ax

	call drawRectangle 

	;eye
	mov dx, bx
    add dx, 2
	mov ax, dx          ;row no
	push ax

    mov dx, cx
    add dx, 10
	mov ax, dx          ;column no
	push ax

	mov ax, 3           ;length
	push ax

	mov ax, 3           ;width
	push ax

	mov ax, 0x00
	push ax

	call drawRectangle 

	;beak
    mov dx, bx
    add dx, 7
	mov ax, dx          ;row no 
	push ax

	mov dx, cx
    add dx, 13
    mov ax, dx          ;column no
	push ax

	mov ax, 3           ;length
	push ax

	mov ax, 5           ;width
	push ax

	mov ax, 0x5C
	push ax

	call drawStrokedRectangle

    pop dx
    pop cx
    pop bx
    pop ax
    mov sp, bp
    pop bp

    ret 4

