	call drawStrokedRectangle 

	mov ax, bx
	add ax, 15
	push ax
	mov ax, cx
	sub ax, 15
	push ax
	mov ax, 5
	push ax
	mov ax, 35
	push ax
	mov ax, dx
	push ax
	call drawStrokedRectangle 
	
	pop dx
	pop cx
	pop bx
	pop ax
	mov sp, bp
	pop bp

	ret 6

drawPipes:
    push bp
    mov bp, sp
    push ax
    push bx
    push cx
    push dx

    ;Logic of building pipe (To be in valid range: l1 + l2 = 140 - height diff) --> This equation must be satisfied 
    ;Upper pipe = drawStrokedRectangle(0, starting_col, length, 30, colour)
    ;Upper pipe's boundary = drawStrokedRectangle(length, starting_col - 4, 10, 38, colour)
    ;Lower pipe's boundary = drawStrokedRectangle(length + 10 + height_diff, starting_col - 4, 10, 38, colour)
    ;Lower pipe = drawStrokedRectangle(length + 20 + height_diff, starting_col - 4, 140 - length - height_diff, 30, colour)
    
    ;Upper pipe
    mov ax, 0            ;row no 
	push ax
	mov ax, [bp+10]      ;column no
	push ax
	mov ax, [bp+8]       ;length
	push ax
	mov ax, 30           ;width
	push ax
	mov ax, [bp+4]
	push ax
	call drawStrokedRectangle 

    ;Upper pipe's boundary
    mov ax, [bp+8]       ;row no 
	push ax
	mov ax, [bp+10]      ;column no
    sub ax, 4
	push ax
	mov ax, 10           ;length
	push ax
	mov ax, 38           ;width
	push ax
	mov ax, [bp+4]
	push ax
	call drawStrokedRectangle 

    ;Lower pipe's boundary
    mov ax, [bp+8]          ;row no 
    add ax, 10
    add ax, [bp+6]
	push ax
	
    mov ax, [bp+10]      ;column no
    sub ax, 4
	push ax

	mov ax, 10           ;length
	push ax

	mov ax, 38           ;width
	push ax

	mov ax, [bp+4]
	push ax
	call drawStrokedRectangle 

	;Lower pipe
    mov ax, [bp+8]          ;row no 
    add ax, 20
    add ax, [bp+6]
	push ax
	
    mov ax, [bp+10]      ;column no
	push ax

	mov ax, 140           ;length
    sub ax, [bp+8]
    sub ax, [bp+6]
	push ax

	mov ax, 30           ;width
	push ax

	mov ax, [bp+4]
	push ax
	call drawStrokedRectangle 

    pop dx
    pop cx
    pop bx
    pop ax
    mov sp, bp
    pop bp

    ret 8

printGameState:
    push bp
    mov bp, sp
    push ax
    push bx
    push cx
    push dx

    call cls
	call setupPaletteBG
    call drawSky 
    call drawBackground

    ;starting_col + length + height diff + colour of pipes
	mov ax, [bp+4]
	push ax
	mov ax, 40
	push ax
	mov ax, 40
	push ax
	mov ax, 0x60
	push ax
	call drawPipes

	;XY + Colour of Cloud 1
	mov ax, 10
	push ax
	mov ax, 50
	push ax
	mov ax, 0x77
	push ax
	call drawCloud

	;XY + Colour of Cloud 2
	mov ax, 10
	push ax
	mov ax, 180
	push ax
	mov ax, 0x77
	push ax
	call drawCloud
	
	;XY coordinates of the bird
    mov ax, 65
    push ax
    mov ax, 45
    push ax
    call drawBirdXY

	;Clearing stack
    pop dx
    pop cx
    pop bx
    pop ax
    mov sp, bp
    pop bp

    ret 4

delay:
    push bp
    mov bp, sp
    push cx

    mov cx, 0xFFFF
    
    delayLoop:
        loop delayLoop

    mov cx, 0xFFFF
    
    delayLoop2:
        loop delayLoop2

    mov cx, 0xFFFF
    
    delayLoop3:
        loop delayLoop3

    pop cx
    mov sp, bp
    pop bp

    ret

start:
    mov cx, 65         ; number of times to render
	mov ax, 280		   ; initial y coordinate of pipes
    call gameLoop

gameLoop:
    call delay

	push ax

    call printGameState

	sub ax, 5		   ; speed of the game

	loop gameLoop

exit:
    mov ah,0
    int 16h
    int 20h